INSERT [dbo].[T_TranslationText] ([OriginalHash], [LanCode], [TranslationText]) VALUES (N'WQkex4MX5BSKpkFBLR+nGMydMk9BFB7GYrgthDX1L1k=', N'en-US', N'
I was working on this project at the time of Chainlink''s hackathon (early December 2023), and I participated in the event to meet some of my peers and learn about industry opportunities, which would be even better if I won an award.
This version of the DAPP applies a new liquidity algorithm that uses UniswaV3 and Chainlink''s price oracle to implement the simplest options (binary options). This version is 1.0, and I hope to reach the level of commercial application.

But I noticed that Oracle''s price data is "blunted", that is, there is an accuracy, such as one thousandth. Price changes within this range of precision should be treated as if the price did not change. The harm of not having this accuracy is great, so I won''t expand on it here.
Because of this precision, Chainlink can only update the price once or twice an hour, and the price of UniswapV3 (relative to a certain precision) also changes slowly, which makes the price of binary options in this five-minute period remain unchanged most of the time, so it is unreasonable for players to lose regardless of whether their investment goes up or down.
How can this be changed? There are two ways.
The first is to increase the time period of binary options, changing five minutes to one hour, but in doing so, the playability of the DAPP is reduced.
Another way is to change the binary option to ''ternary option'', and add an option so that the price does not change. The so-called price constant does not mean that the price does not change at all, but refers to the rise and fall of the price in a range, such as one thousandth, if it is in this range, the price is considered unchanged.
The second method is a bit different from traditional binary options, and there may be an acceptance process.
In addition, the algorithm for liquidity needs to be optimized a little bit.

After version 1.0, I plan to update the liquidity algorithm and launch ternary options, which can be regarded as version 2.0. But I can''t promise that I''ll release version 2.0 because my own schedule is not fixed, and it''s just a plan at the moment.
')
GO
